import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import PersistGate from 'redux-persist';
import { store, persistor } from './store';

ReactDOM.render(
	<PersistGate persistor={persistor}>
	<App />
	</PersistGate>, 
	document.getElementById('root'));
